import React from "react";

import "./App.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import ListTransaksiComponent from "./components/ListTransaksiComponent";
import HeaderComponent from "./components/HeaderComponent";
import FooterComponent from "./components/FooterComponent";
import CreateTransaksiComponent from "./components/CreateTransaksiComponent";
import ViewTransaksiComponent from "./components/ViewTransaksiComponent";

function App() {
  return (
    <div>
      <Router>
        <HeaderComponent />
        <div className="container">
          <Switch>
            <Route path="/" component={ListTransaksiComponent}></Route>
            <Route path="/transaksi" component={ListTransaksiComponent}></Route>
            <Route
              path="/add-transaksi/:id"
              component={CreateTransaksiComponent}
            ></Route>
            <Route
              path="/view-transaksi/:id"
              component={ViewTransaksiComponent}
            ></Route>
          </Switch>
        </div>
        <FooterComponent />
      </Router>
    </div>
  );
}

export default App;
